-- ----------------------------
--  Procedure structure for `add_appointment`
-- ----------------------------
DROP PROCEDURE IF EXISTS `add_appointment`;
delimiter ;;
CREATE  PROCEDURE `add_appointment`(pexamId int, pstatus int, pId varchar(50), pseatId int)
begin
	declare row_ int;
	declare result_ int;
	select count(*) into result_ from appointments where appointments.examId = pexamId and appointments.student = pid;
	if result_ = 0 then
		insert into appointments (appointments.examId,appointments.status,appointments.student,appointments.seatId) values (pexamId,pstatus,pid,pseatId);
		SELECT LAST_INSERT_ID() into row_;
		select row_ as result;
	else
		set result_ = -1;
		select result_ as result;
	end if;
	
end
 ;;
delimiter ;

