DROP PROCEDURE IF EXISTS `add_class`;
delimiter ;;
CREATE  PROCEDURE `add_class`(pclassId varchar(20), psubject varchar(10), pcatalog int, psection varchar(10), pinstructorNetID varchar(50), pclassName varchar(50))
begin
		declare row_ int;
	declare result_ int;
	select count(*) into result_ from classes where classes.classId = pclassId;
	if result_ = 0 then	
		insert into classes 
					(classes.classId,classes.subject,classes.catalogNumber,classes.section,classes.instructorNetID,classes.className)
			VALUES(pclassId,psubject,pcatalog,psection,pinstructorNetID,pclassName);
		SELECT LAST_INSERT_ID() into row_;
		select row_ as result;
	ELSE
		
		set result_ = -1;
		select result_ as result;
	end if;

		
end
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `add_exam`
-- ----------------------------
DROP PROCEDURE IF EXISTS `add_exam`;
delimiter ;;
CREATE  PROCEDURE `add_exam`(pclass int, pidentifier varchar(20), pexamType int, pstart datetime, pend datetime, pduration int, pterm int)
begin

	declare row_ int;
	declare result_ int;
	select count(*) into result_ from EXAMS where EXAMS.identifier = pidentifier;
	if result_ = 0 then
		insert into 
				EXAMS (EXAMS.classId,EXAMS.duration,EXAMS.beginTime,EXAMS.endTime,EXAMS.examType,EXAMS.term,EXAMS.identifier)
		values
				(pclass,pduration,pstart,pend,pexamType,pterm,pidentifier);
		SELECT LAST_INSERT_ID() into row_;
		select row_ as result;
	else
		set result_ = -1;
		select result_ as result;
	end if;

end
 ;;
delimiter ;

