begin

	declare row_ int;
	update appointments set appointments.status = pStatus where appointments._id = pappointmentId;
	SELECT ROW_COUNT() into row_;
	select row_ as result;

end
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `check_time`
-- ----------------------------
DROP PROCEDURE IF EXISTS `check_time`;
delimiter ;;
CREATE  PROCEDURE `check_time`(pStart datetime, pEnd datetime, pStudent varchar(50))
BEGIN
	select count(*) as result 
		from appointments 
	    where  
					(HOUR(pEnd) < HOUR(appointments.startTime) 
				or 
					HOUR(pStart) > HOUR(appointments.endTime))
				and 
					appointments.student = pStudent;
END
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `delete_appointment`
-- ----------------------------
DROP PROCEDURE IF EXISTS `delete_appointment`;
delimiter ;;
CREATE  PROCEDURE `delete_appointment`(pid varchar(50), pappointmentId int, prole int)
begin
	
declare row_ int;
	

	delete from appointments where appointments._id = pappointmentId and (appointments.student = pid or prole = 3);
	SELECT ROW_COUNT() into row_;
	select row_ as result;

end
 ;;
delimiter ;

