-- ----------------------------
--  Procedure structure for `getReminders`
-- ----------------------------
DROP PROCEDURE IF EXISTS `getReminders`;
delimiter ;;
CREATE  PROCEDURE `getReminders`()
begin
	declare _interval int;
	select TSCInfo.reminderInterval into _interval FROM TSCInfo;
	select users.firstName,users.lastName,users.email,classes.className,appointments.startTime,seats.seatNumber
				from appointments,users,EXAMS,classes,seats
				where 	
							appointments.student = users.userId  
						and 
							appointments.examId = EXAMS._id
						and 
							EXAMS.classId = classes._id
						and 
							appointments.seatId = seats._id
						and
							UNIX_TIMESTAMP(startTime) - UNIX_TIMESTAMP(NOW()) < _interval * 60*1000;
end
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `get_adhoc_exam`
-- ----------------------------
DROP PROCEDURE IF EXISTS `get_adhoc_exam`;
delimiter ;;
CREATE  PROCEDURE `get_adhoc_exam`(pstudentId varchar(50), prole int)
begin
		if prole = 3 THEN
				select EXAMS.* from EXAMS,adhoc_student
						where adhoc_student.examId = EXAMS._id;
						
		ELSE	
				select EXAMS.* from EXAMS,adhoc_student
						where adhoc_student.examId = EXAMS._id AND adhoc_student.studentId = pstudentId;
		end if;
		
end
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `get_appointments`
-- ----------------------------
DROP PROCEDURE IF EXISTS `get_appointments`;
delimiter ;;
CREATE  PROCEDURE `get_appointments`(pstuId int, prole int, poffset int)
begin
	if prole = 3 then
		select appointments.*,seats.seatNumber,classes.term as termId from appointments,seats,EXAMS,classes where appointments.seatId = seats._id 
			and appointments.examId = EXAMS._id and EXAMS.classId = classes._id
			limit poffset,15;
	else
		select appointments.*,seats.seatNumber,courses.termId from appointments,seats,EXAMS,classes where appointments.student = pstuId and appointments.seatId = seats._id 
		and appointments.examId = EXAMS._id and EXAMS.classId = classes._id
		limit poffset,15;
	end if;
	
end
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `get_ava_seats`
-- ----------------------------
DROP PROCEDURE IF EXISTS `get_ava_seats`;
delimiter ;;
CREATE  PROCEDURE `get_ava_seats`(pexamId int, role int)
begin
	
		if role = 3 then
			select * from seats where seats._id not in(select seatId from appointments where examId = pexamId);
		else
			select * from seats where seats._id not in(select seatId from appointments where examId = pexamId) and seats.seatType != 1;
		end if;
end
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `get_student_exams`
-- ----------------------------
DROP PROCEDURE IF EXISTS `get_student_exams`;
delimiter ;;
CREATE  PROCEDURE `get_student_exams`(pid varchar(50), prole int)
begin
		if prole = 3 THEN
				select EXAMS.*,classes.className from EXAMS,classes,adhoc_student
						where (EXAMS.classId = classes._id and EXAMS.examType = 0);
						
		ELSE	
				select EXAMS.*,classes.className from EXAMS,classes,users 
						where EXAMS.classId in(select classes._id from roster,classes where roster.netId = pid and classes.classId = roster.classId)
								and EXAMS._id not in (select appointments.examId from appointments where appointments.student = pid) 
								and EXAMS.classId = classes._id;
		end if;
		
end
 ;;
delimiter ;

