-- ----------------------------
--  Procedure structure for `update_TSC`
-- ----------------------------
DROP PROCEDURE IF EXISTS `update_TSC`;
delimiter ;;
CREATE  PROCEDURE `update_TSC`(pcloseStart datetime, pcloseEnd datetime, pnumOfSeat int, pnumOfAside int, pgap int, pinterval int, phours varchar(20))
begin

	declare row_ int;
	update TSCInfo set  
	TSCInfo.closeStart = pcloseStart,
	TSCInfo.closeEnd = pcloseEnd,
	TSCInfo.numberOfSeat = pnumOfSeat,
	TSCInfo.numberOfAsideSeats = pnumOfAside,
	TSCInfo.openHours = phours,
	TSCInfo.reminderInterval = pinterval,
	TSCInfo.gap = pgap;
	SELECT ROW_COUNT() into row_;
	select row_ as result;
end
 ;;
delimiter ;

-- ----------------------------
--  Procedure structure for `view_requests`
-- ----------------------------
DROP PROCEDURE IF EXISTS `view_requests`;
delimiter ;;
CREATE  PROCEDURE `view_requests`(prole int, puserid int)
begin
	if prole = 3 then
		select * from requests order by requests.`status`;
	ELSE
		select * from requests where requests.userId = puserId order by requests.`status`;
	end if;
end
 ;;
delimiter ;

